import "./header.css"

export default function Header() {
  return (
    <div className='header'>
        <div className="headerTitles">
            <span className="headerTitleSm">Akku and abhi</span>
            <span className="headerTitleLg">Blog</span>
        </div>
        <img className="headerImg" src="https://media.istockphoto.com/id/1426559579/photo/female-tourist-enjoying-watching-hot-air-balloons-flying-in-the-sky-at-rooftop-of-hotel-where.jpg?b=1&s=612x612&w=0&k=20&c=m7qypp0ufhZmNwzF5th48NF0c0oCG8ysuxGr5tBFRKY=" alt="" />
        </div>
  )
}
